export const Statistics = ({ stats }) => {
  stats.map(stat => {
    return (
          <li class="item" key={stat.id}>
            <span class="label">{stat.label}</span>
            <span class="percentage">{stat.percentage}%</span>
          </li>
    );
  });
};
